alt-trans.target:
--registrador | / registrador: < Logger Uri/FriendlyName >
      Especifique un registrador para los resultados de la prueba.  Por ejemplo, para registrar los resultados en un archivo de resultados de prueba (TRANS) de Visual Studio use /logger:trx.
      Para publicar los resultados de la prueba en Team Foundation Server, utilice TfsPublisher como se muestra a continuación
      Ejemplo: /logger:TfsPublisher;
                Colección = < url de colección de proyecto de equipo >;
                BuildName = < nombre de compilación >;
                TeamProject = < nombre del proyecto >
                [; Plataforma = < el valor predeterminado es "Cualquier CPU" >]
                [; Sabor = < el valor predeterminado es "Debug" >]
                [; RunTitle = < title >]
